import React, { useState } from 'react';
import characters from '../data/characterData';AnimePage

const AnimePage = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <div className="text-gray-800">
      {/* Navbar */}
      <nav className="bg-blue-500 text-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between h-16 items-center">
            {/* Logo */}
            <div className="flex-shrink-0 web_logo">
              <a href="#" className="text-2xl font-bold">Animefy</a>
            </div>

            {/* Desktop Links */}
            <div className="hidden md:flex space-x-6">
              <a href="#" className="hover:text-gray-300">Home</a>
              <a href="#" className="hover:text-gray-300">About</a>
              <a href="#" className="hover:text-gray-300">Services</a>
              <a href="#" className="hover:text-gray-300">Contact</a>
            </div>

            {/* Mobile Button */}
            <div className="md:hidden">
              <button onClick={toggleMobileMenu} className="focus:outline-none">
                <svg className="h-6 w-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2"
                    d="M4 6h16M4 12h16M4 18h16" />
                </svg>
              </button>
            </div>
          </div>
        </div>

        {/* Mobile Menu */}
        {isMenuOpen && (
          <div className="md:hidden px-4 pb-4">
            <a href="#" className="block py-2">Home</a>
            <a href="#" className="block py-2">About</a>
            <a href="#" className="block py-2">Services</a>
            <a href="#" className="block py-2">Contact</a>
          </div>
        )}
      </nav>

      {/* Main Container */}
      <div className="container w-full mx-auto">
        <div id="cardContainer" className="container w-full mx-auto">
          {/* Future character cards rendered here */}
        </div>

        <div id="videoPlayer" className="hidden flex flex-col items-center justify-center min-h-screen text-white">
          <iframe className="absolute" src="" frameBorder="0" allow="autoplay; encrypted-media" allowFullScreen></iframe>
        </div>
      </div>
    </div>
  );
};

export default AnimePage;
